import React from "react";
import {Link} from "react-router-dom";

const Navbar = () =>{
    return(
        <>
        <nav className="flex text-slate-200 text-xl space-x-4 uppercase cursor-pointer bg-zinc-500">
           <Link  to="" className="hover:bg-orange-400"> About Us </Link>
           <Link  to="" className="hover:bg-orange-400"> Contact Us </Link>
           <Link  to="" className="hover:bg-orange-400"> PokeApi </Link>
           <Link  to="" className="ani animate-pulse hover:bg-orange-400"> Covid Tracker </Link>
        </nav>
           
        </>
    )
}

export default Navbar;
